(window.webpackJsonp=window.webpackJsonp||[]).push([[384],{1012:function(n,s){n.exports="\x3c!--\ntitle: 内网穿透\nsort:\n--\x3e\n\n## 自搭\n\n> [Release](https://github.com/fatedier/frp/releases)\n\n### 服务端配置\n\n```ini\n# vim frps.ini\n[common]\n# 连接端口\nbind_port = 7000\n# 控制板端口,用于网页查看状态\ndashboard_port = 7800\n# 连接密码\ntoken = passswd_token\n# z\nmax_pool_count = 5\n# 控制板登录用户名密码\ndashboard_user = name\ndashboard_pwd = passwd\n\n# 运行一下试试\n./frps -c ./frps.ini\n```\n\n### 自启动\n\n> 为 frps 创建 services\n>\n> 项目中 service 文件已经写好,直接 copy 过去就可以\n\n```bash\n# 进入frp的systemd目录\ncp ./systemd/frps.service /lib/systemd/system/\n# @的服务可自定义配置文件名\ncp ./systemd/frps@.service /lib/systemd/system/\n\n\n# 把frps与配置文件拷贝到其应在的目录\ncp frps /usr/bin\nmkdir /etc/frp\ncp frps.ini /etc/frp\n\n# 启动服务\n# 重载services\nsystemctl daemon-reload\n# 尝试运行\nsystemctl start frps\n# 开机自启动\nsystemctl enable frps\n```\n\n## 客户端配置\n\n```ini\n# vim frpc.ini\n[common]\n# 写服务端信息\nserver_addr = ip\nserver_port = 7000\ntoken = passwd_token\n\n[localhost]\n# 写你要开放的端口\ntype = tcp\nlocal_ip = 127.0.0.1\nlocal_port = 22\n# 用英文写的下面这行注释,这句话十分重要\nremote_port = [make sure your server open this port on filrewall]\n```\n\n### 自启\n\n```bash\n# 进入frp的systemd目录\ncp ./systemd/frpc.service /lib/systemd/system/\ncp ./systemd/frpc@.service /lib/systemd/system/\n\n# 把frpc与配置文件拷贝到其应在的目录\ncp frpc /usr/bin\nmkdir /etc/frp\ncp frpc.ini /etc/frp\n# 尝试运行\n/usr/bin/frpc -c /etc/frp/frpc.ini\n\n# 启动服务\n# 重载services\nsystemctl daemon-reload\n# 尝试运行\nsystemctl start frpc\n# 开机自启动\nsystemctl enable frpc\n```\n"}}]);